INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(1, 1, 'Riverside Apartment in Brisbane City', '202 Bowen Terrace New Farm QLD 4005', NULL, NULL, 'Enjoy Brisbane for Easter or to attend the Commonwealth Games. \r\n\r\nLight decor with plenty of space for 3 adults. All the facilities that you might want to enjoy a relaxing holiday in our home. The second bedroom room is an office but there is a single bed.\r\n\r\nCentral location with bars, restaurants, museums, galleries and nightlife all within a short walk. \r\n\r\nExcellent public transport with ferry, bus and trains close plus walking paths along the river are a great way to explore the area.\r\n\r\nThe space\r\n\r\nOur apartment has fantastic views to Story Bridge and the City.\r\n\r\nIt is so easy to move around using local public transport including by train to get to the Commonwealth Games on the Gold Coast.\r\n\r\nGuest access\r\n\r\nThe apartment comes with a pool and gym. Also you walk out onto the riverside and then walk to Southbank, City, Eagle Street Riverside, Fortitude Valley to name just a few.\r\n\r\nInteraction with guests\r\n\r\nTara will be available to assist as well as the management office in the apartment.\r\n\r\nOther things to note\r\n\r\nSometimes you can hear music from across the river from the Jazz Club. You can also hear music later in the week and weekend from \"Fridays\" bar. The volume is not a problem as we are far enough away. I like hearing the music so I\'m not concerned by it.\r\n\r\nNo smoking\r\nNot suitable for pets\r\nNo parties or events\r\nNot safe or suitable for infants (Under 2 years)\r\nCheck-in time is 4PM - 6PM\r\nCheck out by 10AM', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(2, 1, 'Convenient (ground level) self-contained Granny flat', '150 James Street New Farm QLD 4005', NULL, NULL, 'Granny flat on ground level. Large open plan with kitchenette including microwave. Undercover area 150m from public transport, street parking if needed. 4 minutes to CBD. Upstairs occupied by couple, 2 cats and a dog. Very comfortable and convenient to Suncorp (1.8km), CBD, QUT Kelvin Grove campus (1.2km), cafes, restaurants etc.\r\n\r\nGuest access\r\n\r\nPrivate access to ground floor Granny flat with kitchenette, bathroom and air con.\r\n\r\nInteraction with guests\r\n\r\nWe are just up stairs if you need anything!', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(3, 1, 'Luxury living in Kangaroo Point', '19 Wicklow Street Kangaroo Point QLD 4169', NULL, NULL, 'This Luxury Appartment is situated in a beautiful Suburb called Kangaroo Point, very close to the CBD. It\'s close to City Hopper, (Free River Ferry) its the quickest transport to Brisbane CBD (a 5 minute trip across the river) the appartment is large, spacious and luxurious.\r\n\r\nThe space\r\n\r\nIt\'s a large 3 bedroom apartment and guest area is very private, situated at other end of the space. Great breezes flow through the space and has plenty of natural light. It is very luxurious and the large balcony is perfect to sit and relax while watching the activity on the river.\r\nThis is a Million dollar apartment and you\'ll quickly feel it\'s warmth and luxury with natural Feng Sui sweeping throughout.\r\n\r\nGuest access\r\n\r\nSwimming pool, Gym, Sauna, free wifi, car parking,\r\n\r\nInteraction with guests\r\n\r\nI work nights so mainly around during the mornings. I run restaurants and am very good with people, picking up quickly if you need your space or you feel like sitting for a chat and company. Sharing a glass of wine or a beer. The place is very relaxing and people melt away into this luxurious space.\r\n\r\nOther things to note\r\n\r\nIncluded in the Airbnb booking are the following \r\n# Your own room and shared bathroom\r\n# Wifi\r\n# Laundry facilities \r\n# Sheets, towels etc\r\n# kitchen facilities \r\n# A light breakfast \r\nPlease note that only a light breakfast is included in the room rate.', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(4, 2, 'Stunning 3 bedroom home close to everything!', '35 Brookfield Road Kedron  QLD 4031', NULL, NULL, 'Our place is located in kedron, 15 minutes from the airport/10 minutes from the city! Shops and cafe close by and great for transport.\r\n\r\nThe home has 3 bedrooms and a beautiful open plan kitchen and living area with beautiful front and back deck.\r\n\r\nIts great for small families staying in brisbane who want to relax, whilst still being close to the city!\r\n\r\nThere\'s another small house at the back of the property which shares a garden with the house and the tenant has a beautiful friendly dog\r\n\r\nThe space\r\n\r\nThe home has 3 bedrooms and a beautiful open plan kitchen and living area with beautiful front and back deck.\r\n\r\nInteraction with guests\r\n\r\nWe are available as much or little as you like :)', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(5, 2, 'Modern furniture, own bathroom and toilet', '37 Hawbridge Street Carseldine QLD 4034', NULL, NULL, 'modern townhouse, almost brand new, 10 minutes walk to bus and train. Few shopping center nearby.\r\n14k from the CBD\r\n\r\nThe space\r\n\r\nVery private room downstairs, have your own bathroom with bath tub and toilet. Your private access to your own courtyard with outdoor settings. Nice comfy queen bed and cupboards with mirror doors.\r\n\r\nGuest access\r\n\r\nShare a modern kitchen and a big lounge with big tv. There\'s a balcony opposite lounge where you can watch the sunset.\r\n\r\nInteraction with guests\r\n\r\nI work in hospitality industry and used to people interactions but do respect everyones privacy if required.', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(6, 2, 'Private 2 bedroom granny flat in a quiet street.', '22 Rylatt Street Indooroopilly QLD 4068', NULL, NULL, 'Lovely private downstairs 2 bedroom granny flat with ensuite and kitchenette at the end of a quiet leafy cul de sac. Breakfast pack included on arrival.\r\n\r\nThe space\r\n\r\nEach room has a bed, desk, bedside table & plenty of storage. Private bathroom, entrance, kitchenette & living room. Shared laundry facilities, on site parking and private courtyard. Unlimited internet, no pets, smoking outdoors, suitable for children. Accommodates up to 4 guests.\r\n\r\nGuest access\r\n\r\nVeranda attached to main house upstairs can be used by guests. Oven available upstairs. Clothes dryer can be used on rainy days (small fee applies). Detergent can be used for a small fee.\r\n\r\nInteraction with guests\r\n\r\nWe are a small family with an 11 year old daughter. We love meeting new people from all walks of life and enjoy getting to know our guests however if you need your privacy we are happy to respect your needs.\r\n\r\nOther things to note\r\n\r\nPlease be mindful of noise levels both inside the property and when arriving or leaving early in the mornings (prior to 8am) or late in the evenings (past 9pm).\r\nPlease do not slam the doors or turn the water on and off excessively as we do live directly above the granny flat and it can be quiet loud. We will pay you the same respect while you are staying with us :)\r\nWashing detergent can be provided for a $2 fee per load. \r\nClothes dryer can be used for a $2 fee per load. \r\nPlease do not use the clothes dryer or detergent unless you have asked the host. \r\nClothes lines are available throughout your accommodation (Bathroom door, in the laundry and on the left hand side of the property).', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(7, 3, 'Cozy room in St Lucia Sharehouse', '162 Ninth Ave St Lucia QLD 4067', NULL, NULL, 'One of our room mates is moving out so we are looking to fill their spot while we \r\nfind somebody permanent. Room will be fully furnished with fresh linen etc so \r\nall ready to go for Air BnB. You will be sharing the house with the other room \r\nmates who are all doing their own thing in their own time so they may be around \r\nfor a beer or busy, just depends on the time of week. \r\nPlease note we are only looking for people between the ages 18-35.', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(8, 3, 'Highgate Hill... Leafy studio by the river', 'Highgate Hill Queensland 4101', NULL, NULL, 'Exclusive, private studio apartment in a quiet leafy pocket of Highgate Hill. Its a stones throw to transport links with the closest bus stop only 100m away, and a short walk to the City Cat ferry to easily reach Brisbane City CBD (banks & shopping), Gallery of Modern Art, Convention Centre & Museum, Southbank parklands with cafes and bars, and Fortitude Valley (nightlife). Also, enjoy easy access to the local vibrant caf and bar scenes of West End plus Queensland and QUT Universities.\r\n\r\nThe space\r\n\r\nYou will have sole access to the studio and balcony with elevated beautiful views of the Brisbane River and the University of Queensland. The studio is safe and secure with its own entry.\r\n\r\nGuest access\r\n\r\nThere is private access to the studio and balcony.\r\nSafe storage for a push bike.\r\nFree on-street parking.\r\n\r\nInteraction with guests\r\n\r\nThe studio is attached to the main house so the hosts are available most times for any assistance if required.\r\n\r\nOther things to note\r\n\r\nNo smoking\r\nNot suitable for pets\r\nNo parties or events\r\nNot suitable for children', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(9, 3, '2 Bed/2 Bath with Breathtaking City & River views', '420 Queen St, Brisbane City QLD 4000', NULL, NULL, 'Breathtaking view!! This spacious 2 bedroom apartment place is close to the city centre, parks, art and culture. Is is a great place for couples and business travellers alike.\r\n\r\nLocated on the 12th floor this apartment is just a short stroll to the retail precinct around the Queen St Mall, the sites alone Brisbane river and even across to Southbank.\r\n\r\nWhether its for work or pleasure this apartment is sure to please due to the great view, spacious layout and wonderful central location.\r\n\r\nThe space\r\n\r\nThe apartment contains two spacious bedrooms and 2 bathrooms, 1 being and ensuite.\r\n\r\nGuest access\r\n\r\nGuests have access to free WiFi and a fully equiped kitchen.', );
INSERT INTO `accommodation` (`aid`, `uid`, `name`, `location`, `latitude`, `longitude`, `descr`, `photos`) VALUES
(10, 1, 'Alice\'s Place Greenslopes', '103 Juliette St Greenslopes QLD 4120', NULL, NULL, 'This 1 bedroom furnished apartment conveniently located close to Brisbane CBD, 3 minutes walk to Greenslopes Hospital and 1 minute walk to the closest bus stop. \r\nThe flat is fitted with an electric oven, microwave and cooktop. It has an open plan living / meals area with split system heating/cooling and access to your own private courtyard. The bathroom has a large shower and there is a walk-in-robe.\r\n\r\nThe space\r\n\r\nSingles or couples\r\n\r\nGuest access\r\n\r\nYou have the use of the entire flat with private entry and a small courtyard.', );

